import React, { Component } from 'react';
import './App.css';
import ReactApexChart from "react-apexcharts";
import { ApexOptions } from "apexcharts";

class App extends Component {
  state = {
    stocks: []
  };

  async componentDidMount() {
    const response = await fetch('/api/stocks/tsla');
    const body = await response.json();
    this.setState({stocks: body});
  }

  render() {
    const {stocks} = this.state;
    return (
        <div className="App">
            <div className="App-intro">
              <table>
              <tr>
              <th> Date </th>
              <th> Ticker </th>
              <th> Open </th>
              <th> High </th>
              <th> Low </th>
              <th> Close </th>
              <th> Adjusted Close </th>
              <th> Volume </th>
              </tr>
              {stocks.map(stocks => 
                   <tr>
                   	<td> {stocks.date} </td>
                    <td> {stocks.ticker} </td>
                    <td> {stocks.open} </td>
                    <td> {stocks.high} </td>
                    <td> {stocks.low} </td>
                    <td> {stocks.close} </td>
                    <td> {stocks.adjClose} </td>
                    <td> {stocks.volume} </td>
                   </tr>
              )}
              </table>
            </div>
        </div>
    );
  }
}
class ApexChart extends React.Component {
  state = {
    stocks: [],
    options: {}
  };

  async componentDidMount() {
    const response = await fetch('/api/stocks/tsla');
    const body = await response.json();
    this.setState({
	  	stocks: body,
	  	series: [{
          data: [{
              x: new Date(stocks.date),
              y: [stocks.open, stocks.high, stocks.low, stocks.close]
            },
            ]}],
	    options: {
	      chart: {
	        type: 'candlestick',
	        height: 350
	      },
	      title: {
	        text: 'CandleStick Chart',
	        align: 'left'
	      },
	      xaxis: {
	        type: 'datetime'
	      },
	      yaxis: {
	        tooltip: {
	          enabled: true
	        }
	      }
	    },
	  });
  }
    render() {
  return (
	<div id="chart">
	<ReactApexChart options={this.state.options} series={[this.state.stocks]} type="candlestick" height={350} />
	</div>
  );
  }
}
export default App;
export {ApexChart, App};
